import React, { useState, useEffect } from 'react';
import { Calendar, momentLocalizer } from 'react-big-calendar';
import 'react-big-calendar/lib/css/react-big-calendar.css';
import { format, parseISO, addDays, setHours, setMinutes, nextFriday } from 'date-fns';

// Mock Natural Language Processing function
const parseEventText = (text) => {
  // This is a simplified mock implementation
  // In a real app, you would use a natural language processing API

  const lowerText = text.toLowerCase();

  let title = text;
  let start = new Date();
  let end = new Date();

  // Example parsing logic for "Lunch with Sarah next Friday at noon"
  if (lowerText.includes('lunch') && lowerText.includes('next friday')) {
    title = `Lunch with ${text.split('with')[1].split('next')[0].trim()}`;

    // Set to next Friday at noon
    start = setHours(setMinutes(nextFriday(new Date()), 0), 12);
    end = setHours(setMinutes(nextFriday(new Date()), 0), 13);
  } 
  // Example parsing for "Meeting tomorrow at 3pm"
  else if (lowerText.includes('tomorrow') && lowerText.includes('3pm')) {
    title = `Meeting`;

    // Set to tomorrow at 3pm
    start = setHours(setMinutes(addDays(new Date(), 1), 0), 15);
    end = setHours(setMinutes(addDays(new Date(), 1), 0), 16);
  }
  // Default case - schedule for 1 hour from now
  else {
    start = new Date(new Date().getTime() + 60 * 60 * 1000);
    end = new Date(new Date().getTime() + 2 * 60 * 60 * 1000);
  }

  return {
    title,
    start,
    end
  };
};

function SmartEventEntry() {
  const [events, setEvents] = useState([]);
  const [inputText, setInputText] = useState('');
  const [chatHistory, setChatHistory] = useState([
    {
      sender: 'assistant',
      text: 'Welcome to Smart Event Entry! Type an event in natural language like "Lunch with Sarah next Friday at noon" and I\'ll add it to your calendar.'
    }
  ]);

  // Load saved events from local storage
  useEffect(() => {
    const savedEvents = localStorage.getItem('events');
    if (savedEvents) {
      // Convert string dates back to Date objects
      const parsedEvents = JSON.parse(savedEvents).map(event => ({
        ...event,
        start: new Date(event.start),
        end: new Date(event.end)
      }));
      setEvents(parsedEvents);
    }
  }, []);

  // Save events to local storage when updated
  useEffect(() => {
    if (events.length > 0) {
      localStorage.setItem('events', JSON.stringify(events));
    }
  }, [events]);

  const handleInputChange = (e) => {
    setInputText(e.target.value);
  };

  const handleKeyPress = (e) => {
    if (e.key === 'Enter' && inputText.trim()) {
      handleSubmit();
    }
  };

  const handleSubmit = () => {
    // Add user message to chat
    setChatHistory([
      ...chatHistory,
      { sender: 'user', text: inputText }
    ]);

    // Parse the input text into an event
    const newEvent = parseEventText(inputText);

    // Add the new event to the calendar
    setEvents([...events, newEvent]);

    // Format the dates for display
    const startFormatted = format(newEvent.start, 'EEEE, MMMM d, yyyy h:mm a');
    const endFormatted = format(newEvent.end, 'h:mm a');

    // Add assistant response to chat
    setChatHistory(history => [
      ...history,
      { 
        sender: 'assistant', 
        text: `Added "${newEvent.title}" to your calendar on ${startFormatted} to ${endFormatted}.`
      }
    ]);

    // Clear input
    setInputText('');
  };

  return (
    <div className="flex flex-col h-screen">
      <div className="flex-1 p-6 overflow-hidden">
        {/* Calendar view */}
        <div className="bg-white shadow-md rounded-lg p-4 h-full">
          <Calendar
            localizer={momentLocalizer(require('moment'))}
            events={events}
            startAccessor="start"
            endAccessor="end"
            style={{ height: '100%' }}
            views={['month', 'week', 'day']}
          />
        </div>
      </div>

      {/* Chat interface */}
      <div className="bg-white shadow-md h-72 border-t">
        <div className="flex flex-col h-full">
          <div className="flex-1 p-4 overflow-y-auto">
            {chatHistory.map((message, index) => (
              <div
                key={index}
                className={`mb-3 ${
                  message.sender === 'user' ? 'text-right' : 'text-left'
                }`}
              >
                <div
                  className={`inline-block p-3 rounded-lg ${
                    message.sender === 'user'
                      ? 'bg-primary text-white'
                      : 'bg-secondary text-gray-800'
                  }`}
                >
                  {message.text}
                </div>
              </div>
            ))}
          </div>
          <div className="p-4 border-t flex">
            <input
              type="text"
              className="flex-1 mr-2 input"
              placeholder="Add an event in natural language..."
              value={inputText}
              onChange={handleInputChange}
              onKeyPress={handleKeyPress}
            />
            <button
              className="btn btn-primary"
              onClick={handleSubmit}
              disabled={!inputText.trim()}
            >
              Add
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default SmartEventEntry;
